(2, 2, 'Lampara UV Mata Mosquitos Oferta Única', '1', 24.99, '69.99', 961, 'Hogarzan32', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'off', '', 'off', '{}', '1_5f5160c7-302a-4153-bedc-407005dda6be_540x_1647640500.jpg', '', NULL, 'Dile Adiós a los Mosquitos y Zancudos ¿Los mosquitos en casa no te dejan en paz? Con esta Lampara UV Mata Mosquitos ya no te preocupes más por ellos', NULL, '<h2 data-mce-fragment=\"1\" style=\"outline: none; margin-top: 28px; margin-bottom: 14px; line-height: 1.1; font-size: 1.55556em; color: inherit; text-align: center;\"><span style=\"outline: none; color: rgb(255, 42, 0);\"><span style=\"outline: none; font-weight: 700;\">Dile Adiós a los Mosquitos y Zancudos</span></span></h2><h4 data-mce-fragment=\"1\" style=\"outline: none; margin-top: 14px; margin-bottom: 14px; font-weight: 500; line-height: 1.1; font-size: 1.11111em; color: inherit; text-align: center;\">¿Los mosquitos en casa no te dejan en paz?</h4><h2 data-mce-fragment=\"1\" style=\"outline: none; margin-top: 28px; margin-bottom: 14px; line-height: 1.1; font-size: 1.55556em; color: inherit; text-align: center;\">Con esta<span style=\"outline: none; color: rgb(88, 0, 255);\"> Lampara UV Mata Mosquitos</span><span data-mce-fragment=\"1\" style=\"outline: none;\"> </span>ya no te preocupes más por ellos</h2><p style=\"outline: none; margin-bottom: 14px;\"><span style=\"outline: none;\">Este moderno artefacto para el hogar te ayudará a deshacerte de los molestos mosquitos en cualquier parte de tu casa, solo conecta y listo, su sistema de succión y luz ultravioleta atraerá a los mosquitos rápidamente a su interior, acabando con ellos. Ya no te preocupes por molestas picadas o posibles enfermedades, tampoco te preocupes por el ruido ya que su sonido es prácticamente nulo.</span></p><div style=\"outline: none; text-align: center;\"><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0579/7750/3924/files/8_linea_1878e105-7580-4735-8cc8-00f9827bdbb0.jpg?v=1636141728\" style=\"outline: none; border: 0px; max-width: 100%; float: none;\"></div><div style=\"outline: none; text-align: center;\"><img src=\"https://cdn.shopify.com/s/files/1/0579/7750/3924/files/5_c29b953f-1219-4bb3-87d3-f6730b481ed9.jpg?v=1636236359\" style=\"outline: none; border: 0px; max-width: 100%; float: none;\"></div><div style=\"outline: none; text-align: center;\"><img src=\"https://cdn.shopify.com/s/files/1/0579/7750/3924/files/6_8917d28b-1860-4692-bcb0-d48730ac4b57.jpg?v=1636236380\" style=\"outline: none; border: 0px; max-width: 100%; float: none;\"></div><h2 style=\"outline: none; margin-top: 28px; margin-bottom: 14px; line-height: 1.1; font-size: 1.55556em; color: inherit; text-align: center;\"><span style=\"outline: none; color: rgb(89, 2, 255);\">- Caracteristicas -</span></h2><ul class=\"fa-ul\" style=\"outline: none; margin-bottom: 14px; margin-left: 0px; padding-top: 15px; list-style-position: initial; list-style-image: initial;\"><li style=\"outline: none; margin-bottom: 0.25em; padding-left: 25px; min-height: 12px;\"><span class=\"fa-li fa fa-check-circle\" style=\"outline: none; margin-right: 10px; font-weight: normal; font-stretch: normal; line-height: 1; font-family: FontAwesome; font-size: inherit; transform: translate(0px, 0px); left: 0px; top: 5px;\"></span><span style=\"outline: none;\"><span style=\"outline: none; font-weight: 700;\">Luz ultravioleta</span> con reacción fotocatalítica, simula la humedad del dioxido de carbono producido por el cuerpo, atrayendo mosquitos y moscas a su interior.</span></li><li style=\"outline: none; margin-bottom: 0.25em; padding-left: 25px; min-height: 12px;\"><span class=\"fa-li fa fa-check-circle\" style=\"outline: none; margin-right: 10px; font-weight: normal; font-stretch: normal; line-height: 1; font-family: FontAwesome; font-size: inherit; transform: translate(0px, 0px); left: 0px; top: 5px;\"></span><span style=\"outline: none;\"><span style=\"outline: none; font-weight: 700;\">Sistema de succión</span> de aire que atrapa a cualquier mosquito que pase cerca.</span></li><li style=\"outline: none; margin-bottom: 0.25em; padding-left: 25px; min-height: 12px;\"><span class=\"fa-li fa fa-check-circle\" style=\"outline: none; margin-right: 10px; font-weight: normal; font-stretch: normal; line-height: 1; font-family: FontAwesome; font-size: inherit; transform: translate(0px, 0px); left: 0px; top: 5px;\"></span><span style=\"outline: none;\"><span style=\"outline: none; font-weight: 700;\">Rejilla</span> donde se almacenan los mosquitos atrapados, con un solo giro podrás abrirla y limpiarla.</span></li><li style=\"outline: none; margin-bottom: 0.25em; padding-left: 25px; min-height: 12px;\"><span class=\"fa-li fa fa-check-circle\" style=\"outline: none; margin-right: 10px; font-weight: normal; font-stretch: normal; line-height: 1; font-family: FontAwesome; font-size: inherit; transform: translate(0px, 0px); left: 0px; top: 5px;\"></span><span style=\"outline: none;\"><span style=\"outline: none; font-weight: 700;\">Conexión por cable USB</span> incluido, conectala a la PC, laptop o conecta un cabezal de cargador y enchufala a un tomacorriente directamente.</span></li><li style=\"outline: none; margin-bottom: 0.25em; padding-left: 25px; min-height: 12px;\"><span class=\"fa-li fa fa-check-circle\" style=\"outline: none; margin-right: 10px; font-weight: normal; font-stretch: normal; line-height: 1; font-family: FontAwesome; font-size: inherit; transform: translate(0px, 0px); left: 0px; top: 5px;\"></span><span style=\"outline: none;\"><span style=\"outline: none; font-weight: 700;\">Seguridad de bajo voltaje</span> con ahorro de energía.</span></li><li style=\"outline: none; margin-bottom: 0.25em; padding-left: 25px; min-height: 12px;\"><span class=\"fa-li fa fa-check-circle\" style=\"outline: none; margin-right: 10px; font-weight: normal; font-stretch: normal; line-height: 1; font-family: FontAwesome; font-size: inherit; transform: translate(0px, 0px); left: 0px; top: 5px;\"></sp