(6, 2, 'Llave Multifuncional 360º', '1', 99.99, '159.99', 998, 'Llave78', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'off', '', 'off', '{}', 'WhatsAppImage2021-10-15at12.39.35_83423dab-d078-4f24-9884-d464840ad7eb_1647642965.jpg', '', NULL, 'Multitool 360 es la llave giratoria con la que podrás enroscar y desenroscar toda clase de tornillos y tuercas con un solo movimiento', NULL, '<p style=\"outline: none; margin-bottom: 14px; color: rgb(51, 51, 51); font-family: Oswald, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 30px;\"><span data-mce-fragment=\"1\" style=\"outline: none;\">Multitool 360 es la&nbsp;llave giratoria con la que podrás&nbsp;enroscar y desenroscar toda clase de tornillos y tuercas con</span><span data-mce-fragment=\"1\" style=\"outline: none;\">&nbsp;</span><span data-mce-fragment=\"1\" style=\"outline: none; font-weight: 700;\">un solo movimiento</span><span data-mce-fragment=\"1\" style=\"outline: none;\">. Estamos ante una herramienta&nbsp;que consigue concentrar en un solo utensilio hasta</span><span data-mce-fragment=\"1\" style=\"outline: none; font-weight: 700;\"><span data-mce-fragment=\"1\" style=\"outline: none;\">&nbsp;</span>48 herramientas</span><span data-mce-fragment=\"1\" style=\"outline: none;\">&nbsp;</span><span data-mce-fragment=\"1\" style=\"outline: none;\">diferentes. Ya no tendrás que perder el tiempo buscando la llave que necesitabas, o ajustando una llave inglesa. Con Multitool 360, cambiar el cabezal para disponer del diámetro que necesitas es cuestión de décimas de segundo.</span></p><p style=\"outline: none; margin-bottom: 14px; color: rgb(51, 51, 51); font-family: Oswald, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 30px; text-align: center;\"><img alt=\"48-In-1 Universal Tiger Wrench – Airracks Store\" src=\"https://cdn.shopify.com/s/files/1/0068/0981/3051/files/48-In-1_Universal_Tiger_Wrench_GIF_1_large.gif?v=1542012724\" style=\"outline: none; border: 0px; max-width: 100%;\"></p><p style=\"outline: none; margin-bottom: 14px; color: rgb(51, 51, 51); font-family: Oswald, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 30px; text-align: center;\"><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0600/0754/7129/products/WhatsAppImage2021-10-15at12.39.42_480x480.jpg?v=1634333288\" style=\"outline: none; border: 0px; max-width: 100%;\"></p><p style=\"outline: none; margin-bottom: 14px; color: rgb(51, 51, 51); font-family: Oswald, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 30px;\"><big style=\"outline: none;\"><small style=\"outline: none; font-size: 30.6px;\">El secreto de esta herramienta única es su<span style=\"outline: none;\">&nbsp;</span><span style=\"outline: none; font-weight: 700;\">cabezal giratorio de 360 grados</span>, con el que se pasa de un tamaño a otro de la forma más simple y rápida.</small></big></p><p style=\"outline: none; margin-bottom: 14px; color: rgb(51, 51, 51); font-family: Oswald, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 30px;\"><big style=\"outline: none;\"><small style=\"outline: none; font-size: 30.6px;\">Las llaves normales se suelen resbalar por las esquinas cuando queremos apretar o desapretar una tuerca. En cambio, el interior dentado del tubo de Multitool 360 consigue que esta herramienta alcance el mayor de los agarres, adaptándose a cualquier cabezal. Otra de las grandes ventajas de esta multiherramienta es su capacidad para adaptarse a distintos ángulos, por muy difíciles que estos sean. Multitool 360 está fabricado con una aleación de<span style=\"outline: none;\">&nbsp;</span><span style=\"outline: none; font-weight: 700;\">acero ultra resistente</span>, por lo que durará muchos años funcionando como el primer día. Los manitas del bricolaje se harán inmediatamente fans de una herramienta que pueden llevarse a cualquier parte, evitando tener que trasladar juegos con muchas llaves.</small></big></p><p style=\"outline: none; margin-bottom: 14px; color: rgb(51, 51, 51); font-family: Oswald, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 30px;\">&nbsp;<img src=\"https://cdn.shopify.com/s/files/1/0600/0754/7129/products/20211015_114556_480x480.jpg?v=1634333288\" alt=\"\" data-mce-fragment=\"1\" data-mce-src=\"https://cdn.shopify.com/s/files/1/0600/0754/7129/products/20211015_114556_480x480.jpg?v=1634333288\" style=\"outline: none; margin-right: auto; margin-left: auto; border: 0px; max-width: 100%; display: block;\"></p><p style=\"outline: none; margin-bottom: 14px; color: rgb(51, 51, 51); font-family: Oswald, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 30px;\"><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0600/0754/7129/products/WhatsAppImage2021-10-15at12.39.48_480x480.jpg?v=1634333288\" style=\"outline: none; margin-right: auto; margin-left: auto; border: 0px; max-width: 100%; display: block;\"></p><p style=\"outline: none; margin-bottom: 14px; color: rgb(51, 51, 51); font-family: Oswald, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 30px;\">&nbsp;</p><p data-mce-fragment=\"1\" style=\"outline: none; margin-bottom: 14px; color: rgb(51, 51, 51); font-family: Oswald, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 30px;\"><big data-mce-fragment=\"1\" style=\"outline: none;\"><small data-mce-fragment=\"1\" style=\"outline: none; font-size: 30.6px;\"><span data-mce-fragment=\"1\" style=\"outline: none; font-weight: 700;\">Principales ventajas:</span></small></big></p><ul data-mce-fragment=\"1\" style=\"outline: none; margin-bottom: 14px; margin-left: 20px; list-style: none; color: rgb(51, 51, 51); font-family: Oswald, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 30px;\"><li data-mce-fragment=\"1\" style=\"outl